import React from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";
import { Container, Row, Col } from "react-bootstrap";
import project2Img from "./project2.jpg"; // 이미지 파일 import
import "./projectStyle.css";

export const RootProject = () => {
  return (
    <HelmetProvider>
      <Container className="Project-header">
        <Helmet>
          <meta charSet="utf-8" />
          <title>Root Project | Portfolio</title>
          <meta name="description" content="Detailed page for the Root project" />
        </Helmet>

        {/* 상단에 이미지 추가 */}
        <Row className="project-image-row">
          <Col>
            <img src={project2Img} alt="Project 2" className="project-top-image" />
          </Col>
        </Row>

        <Row>
          <Col>
            <h1>Root Project</h1>
            <p>This page provides detailed information about the Root project.</p>
          </Col>
        </Row>
      </Container>
    </HelmetProvider>
  );
};

export default RootProject;
